Visto che dall&#039;ultimo elenco di nomi &egrave; passato un po&#039; di tempo, ero curioso di scoprire se avevate incontrato altri giocatori con nomi epici. Personalmente ho avuto l&#039;onore di giocare con Quentin Taranteemo, Forrest Gromp e mi pare di ricordare anche un HokutonoKennen. Su youtube ho trovato anche Poroseduto, Mammamiganka (o qualcosa di simile, ora non ricordo perfettamente), Ahridaje, Martin Router King (nome oltretutto usato per la linea Wi-Fi da un altro genio). Rimarranno sempre in mente il support &quot;Dont touch my tralal&agrave;&quot; e il suo adc &quot;hi i&#039;m tralal&agrave;&quot;
Ce ne sono stati altri, di abbastanza carini, ma questi mi sono rimasti in mente. E non sto neppure ad elencare tutti i nomi volgari (che evidentemente molti trovano spassosi, considerando quanti sono).
E voi, che personaggi degni di nota avete incontrato?
